import React from 'react';
import logo from './logo.svg';
import './App.css';

function firstClick() {
  console.log('Primeiro botão!')
}

function secondClick() {
  console.log('Segundo botão!')
}

function thirdClick() {
  console.log('Terceiro botão!')
}

class App extends React.Component {
  render () {
    return <div>
        <button onClick={firstClick}>Primeiro botão</button>
        <button onClick={secondClick}>Segundo botão</button>
        <button onClick={thirdClick}>Terceiro Botão</button>
    </div>
  }
}

export default App;
